import React, { useState, useEffect } from "react";
import UseTable from "./hooks/useTable";
import { useNavigate } from 'react-router-dom'
import axios from 'axios'
export const AddNewRecipe = () => {
    const navigate = useNavigate()
    const [table, setTable] = useState()
    const [Cuisines, setCuisines] =useState()
    const [Diet, setDiet] =useState()
    const [Intolerances, setIntolerances] =useState()
    const [Types, setTypes] =useState()

    const SeeRecipes  = event => {
        if(event.target.id === 'Cuisines'){
            this.setState({
                        username: event.target.value
                    })
        }else if(event.target.id === 'Diet'){
            this.setState({
                        comments: event.target.value
                    })
        }else if(event.target.id === 'Intolerances'){
            this.setState({
                        comments: event.target.value
                    })
        }else if(event.target.id === 'Types'){
            this.setState({
                        comments: event.target.value
                    })
        }
    }
    // useEffect( () => {
    //     console.log('inside useEffect Popular recipes')

    //       axios 
    //         .get('http://localhost:3001/recipesPopular')
    //         .then(res => {
    //             console.log(res)
    //             setTable(res.data[0])
    //         })
    //         .catch(err => {
    //             console.log(err)
    //         })
    // }, [])
    // function addAtDB(id){
    //     axios.post()
    // }
    return (
        <>

            <label for="Cuisines">Which uisine eat today?:</label>
            <select name="Cuisines" id="Cuisines">
                <option value="African">African</option>
                <option value="American">American</option>
                <option value="British">British</option>
                <option value="Cajun">Cajun</option>
                <option value="Caribbean">Caribbean</option>
                <option value="Chinese">Chinese</option>
                <option value="Eastern European">Eastern European</option>
                <option value="European">European</option>
                <option value="French">French</option>
                <option value="German">German</option>
                <option value="Greek">Greek</option>
                <option value="Indian">Indian</option>
                <option value="Irish">Irish</option>
                <option value="Italian">Italian</option>
                <option value="Japanese">Japanese</option>
                <option value="Jewish">Jewish</option>
                <option value="Korean">Korean</option>
                <option value="Latin American">Latin American</option>
                <option value="Mediterranean">Mediterranean</option>
                <option value="Mexican">Mexican</option>
                <option value="Middle Eastern">Middle Eastern</option>
                <option value="Nordic">Nordic</option>
                <option value="Southern">Southern</option>
                <option value="Spanish">Spanish</option>
                <option value="Thai">Thai</option>
                <option value="Vietnamese">Vietnamese</option>
            </select><br/>
            <label for='Diet'>Do you have any specific diet</label>
            <select name='Diet' id='Diet'>
                <option value="Gluten Free">Gluten Free</option>
                <option value="Ketogenic">Ketogenic</option>
                <option value="Vegetarian">Vegetarian</option>
                <option value="Lacto-Vegetarian">Lacto-Vegetarian</option>
                <option value="Ovo-Vegetarian">Ovo-Vegetarian</option>
                <option value="Vegan">Vegan</option>
                <option value="Pescetarian">Pescetarian</option>
                <option value="Paleo">Paleo</option>
                <option value="Primal">Primal</option>
                <option value="Low FODMAP">Low FODMAP</option>
                <option value="Lacto-Vegetarian">Lacto-Vegetarian</option>
                <option value="Ovo-Vegetarian">Ovo-Vegetarian</option>
                <option value="Vegan">Vegan</option>
                <option value="Whole30">Whole30</option>
            </select><br/>
            <label for='Intolerances'>Do you have any Intolerances?</label>
            <select name='Intolerances' id='Intolerances'>
                <option value="Dairy">Dairy</option>
                <option value="Egg">Egg</option>
                <option value="Gluten">Gluten</option>
                <option value="Grain">Grain</option>
                <option value="Peanut">Peanut</option>
                <option value="Seafood">Seafood</option>
                <option value="Sesame">Sesame</option>
                <option value="Shellfish">Shellfish</option>
